void MainEditor::selectRadioPressed(int index)
{
	mSelectButton1->setToggleState(false, false);
	mSelectButton2->setToggleState(false, false);
	mSelectButton3->setToggleState(false, false);
	mSelectButton4->setToggleState(false, false);
	mSelectButton5->setToggleState(false, false);
	mSelectButton6->setToggleState(false, false);
	mSelectButton7->setToggleState(false, false);
	mSelectButton8->setToggleState(false, false);

	switch (index) {
		case 1:
			mSelectButton1->setToggleState(true, false);
			break;
		case 2:
			mSelectButton2->setToggleState(true, false);
			break;
		case 3:
			mSelectButton3->setToggleState(true, false);
			break;
		case 4:
			mSelectButton4->setToggleState(true, false);
			break;
		case 5:
			mSelectButton5->setToggleState(true, false);
			break;
		case 6:
			mSelectButton6->setToggleState(true, false);
			break;
		case 7:
			mSelectButton7->setToggleState(true, false);
			break;
		case 8:
			mSelectButton8->setToggleState(true, false);
			break;
		default:
			break;
	}
}

